import React, { Component } from 'react';
import logo from '../logo.svg';
import './App.css';
import Add_modal from '../components/Add_modal';
import Edit_modal from '../components/Edit_modal';
import Detail_modal from '../components/Detail_modal';
import Delete_modal from '../components/Delete_modal';
import Car_table from '../components/Car_table';



class App extends Component {
  render() {
    return (
      <div className="App container">
            <button type="button" class="btn btn-primary" data-toggle="modal" data-target="#addModal">
                  Add New
            </button>
            <a href="#" ><i class="fa fa-pencil-alt" data-toggle="modal" data-target="#editModal"></i></a>
            <i class="fa fa-trash-alt" data-toggle="modal" data-target="#deleteModal"></i>
            <Car_table />
            <Add_modal />
            <Edit_modal />
            <Detail_modal />
            <Delete_modal />

      </div>
    );
  }
}

export default App;
